<P class="p10 ft2">Capacidad organizativa: Consiste en planear, ordenar y coordinar las acciones de trabajo; sean propias o ajenas.</P>
<P class="p11 ft9">Actitud de Servicio: Hace el trabajo con una mentalidad de eficiente atencin al usuario, considerando a ste ltimo como cualquier persona que requiera de su servicio.</P>
<P class="p12 ft5">Toma de Decisiones: Capacidad para tomar decisiones acertadas y oportunas, empleando la experiencia y el anlisis de las situaciones considerando los siguientes</P>
<P class="p13 ft2">aspectos: certeza, control, orden y rapidez.</P>
<P class="p13 ft2">Trabajo en equipo: Capacidad para trabajar con otras personas de manera armnica y eficiente con orientacin al logro de las tareas y objetivos definidos.</P>
<P class="p14 ft2">Manejo de herramientas de trabajo: Capacidad para manejar eficientemente las herramientas de trabajo (Equipo, programas computacionales, maquinaria, mobiliario, vehculos y tiles de trabajo) que permitan el desarrollo efectivo de las funciones de su puesto.</P>

<P class="p16 ft5">VISIN DE GOBIERNO: SE EVALUA QUE SE DESEMPEE UN TRABAJO INSTITUCIONAL EN APEGO A AL NORMATIVIDAD QUE COMO SERVIDOR PBLICO DEBA DE ACATAR.
